import React, { FC } from "react"
import { Grid, Box, Text } from "@chakra-ui/react"

const ActivityList: FC = () => {
  return (
    <div>
      {[
        { label: "2021", tweetJsons: tweets_2021 },
        { label: "2020", tweetJsons: tweets_2020 },
        { label: "2019", tweetJsons: tweets_2019 },
        { label: "2018", tweetJsons: tweets_2018 },
        { label: "2017", tweetJsons: tweets_2017 },
        { label: "2016", tweetJsons: tweets_2016 },
        { label: "2015", tweetJsons: tweets_2015 },
      ].map(({ label, tweetJsons }, i) => (
        <div key={i}>
          <Text
            paddingY={10}
            fontSize="5xl"
            color="#f5f5f5"
            textShadow="1px 1px 0 #000"
          >
            {label}
          </Text>
          <Grid templateColumns="repeat(auto-fit, minmax(240px, 1fr))" gap={6}>
            {tweetJsons.map((tweetJson, j) => (
              <Box key={j}>
                <embedded-tweet key={j} tweet-json={tweetJson} />
              </Box>
            ))}
          </Grid>
        </div>
      ))}
    </div>
  )
}

export default ActivityList

